import { StatusCodes } from 'http-status-codes';
import { IErrors } from '../types';

export function checkSessionExpired(errors: IErrors): boolean {
    if (errors.keys.includes('errorAttributes')) {
        const errorAttributes = errors['errorAttributes'];
        if (errorAttributes.includes('status')) {
            const status = errorAttributes[0];
            if (status == StatusCodes.UNAUTHORIZED.toString()) {
                return status === StatusCodes.UNAUTHORIZED.toString();
            }
        }
    }
    return false;
 }
